  const [mobileOpen, setMobileOpen] = React.useState(false);
  const [isClosing, setIsClosing] = React.useState(false);

  const handleDrawerClose = () => {
    setIsClosing(true);
    setMobileOpen(false);
  };

  const handleDrawerTransitionEnd = () => {
    setIsClosing(false);
  };

  const handleDrawerToggle = () => {
    if (!isClosing) {
      setMobileOpen(!mobileOpen);
    }
  };

  const list = [
    { name: 'Dashboard', path: '/dashboard', icon: <SpaceDashboardIcon /> },
    { name: 'Category', path: '/categary', icon: <CategoryIcon /> },
    { name: 'SubCategory', path: '/subcategory', icon: <ControlPointDuplicateIcon /> },
    { name: 'Q&A', path: '/qa', icon: <HelpOutlineIcon /> }
  ];

  const drawer = (
    <div>
      <Toolbar sx={{ color: 'white', backgroundColor: '#0d47a1', padding: '5px' }}>
        <Typography variant="h6" noWrap component="div">
          ùêàùêßùê≠ùêûùê´ùêØùê¢ùêûùê∞ ùêèùê®ùê´ùê≠ùêöùê•
        </Typography>
      </Toolbar>

      <Divider />
      <List>
        {list.map((text, index) => (
          <Link key={index} sx={{ textDecoration: 'none', color: '#0d47a1' }} href={text.path}>
            <ListItem disablePadding>
              <ListItemButton
                sx={{
                  '&:hover': {
                    backgroundColor: '#e8f5e9', // soft green hover
                    borderLeft: '4px solid #00897b', // teal accent border
                    transition: '0.3s ease-in-out',
                  },
                }}
              >
                <ListItemIcon sx={{ color: '#00897b' }}>
                  {text.icon}
                </ListItemIcon>
                <ListItemText
                  primary={text.name}
                  sx={{ '& .MuiTypography-root': { fontWeight: 600 } }}
                />
              </ListItemButton>
            </ListItem>
          </Link>
        ))}
      </List>
      <Divider />
    </div>
  );

  return (
    <Box sx={{ display: 'flex' }}>
      <CssBaseline />
      <AppBar
        position="fixed"
        sx={{
          backgroundColor: '#1565c0',
          width: { sm: `calc(100% - ${drawerWidth}px)` },
          ml: { sm: `${drawerWidth}px` },
        }}
      >
        <Toolbar sx={{ justifyContent: 'space-between' }}>
          <IconButton
            color="inherit"
            aria-label="open drawer"
            edge="start"
            onClick={handleDrawerToggle}
            sx={{ mr: 2, display: { sm: 'none' } }}
          >
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" sx={{ fontWeight: 500 }}>
            Dashboard
          </Typography>
          <MeetingRoomIcon />
        </Toolbar>
      </AppBar>

      <Box
        component="nav"
        sx={{ width: { sm: drawerWidth }, flexShrink: { sm: 0 } }}
        aria-label="sidebar links"
      >
        <Drawer
          variant="temporary"
          open={mobileOpen}
          onTransitionEnd={handleDrawerTransitionEnd}
          onClose={handleDrawerClose}
          ModalProps={{ keepMounted: true }}
          sx={{
            display: { xs: 'block', sm: 'none' },
            '& .MuiDrawer-paper': {
              boxSizing: 'border-box',
              width: drawerWidth,
              backgroundColor: '#f5f5f5',
            },
          }}
        >
          {drawer}
        </Drawer>
        <Drawer
          variant="permanent"
          sx={{
            display: { xs: 'none', sm: 'block' },
            '& .MuiDrawer-paper': {
              boxSizing: 'border-box',
              width: drawerWidth,
              backgroundColor: '#f5f5f5',
            },
          }}
          open
        >
          {drawer}
        </Drawer>
      </Box>

      <Box
        component="main"
        sx={{ flexGrow: 1, p: 3, width: { sm: `calc(100% - ${drawerWidth}px)` } }}
      >
        <Toolbar />
        {children}
      </Box>
    </Box>
  );
};

InteviewPortal.propTypes = {
  window: PropTypes.func,
};

export default InteviewPortal;
